					      		<div className="square2" onClick={this.handleGreyClick} id='square19' ></div>
					      		<div className="square3" id='null'></div>
					      	</div>

					      	<div className = 'row'>
					      		<div className="square2" onClick={this.handleGreyClick} id='square11' ></div>
					      		<div className="square3" id='null'></div>			      	
					      		<div className="square3" id='null'></div>
